import React, {useEffect, useState} from 'react'
import Container from 'react-bootstrap/Form';
import Form from 'react-bootstrap/Form';
import InputGroup from 'react-bootstrap/Form';
import 'bootstrap/dist/css/bootstrap.min.css';

var jack = ["hello", "hello"]
function App(){

  const [backendData, setBackendData] = useState([])

  useEffect(() => {
    fetch("/api")
      .then(response => {
        return response.json()
      })
      .then(data => {
        setBackendData(data)
      })
  }, [])

  return (
    <div className=''>
      {backendData}
      <Container>
        <h1>Powerlifting Meets</h1>
        <Form>
          <InputGroup>
            <Form.Control placeholder="filter events"/>
          </InputGroup>
        </Form>
      </Container>
    </div>
  )
}


export default App
